import Cam from '../images/cam.png';
import Add from '../images/add.png';
import More from '../images/more.png';
import Messages from "./Messages";

const Chat = () => {
    return (
        <div className={'chat'}>
            <div className="chatInfo">
                <span>Jim</span>
                <div className="chatIcons">
                    <img src={Cam} alt=""/>
                    <img src={Add} alt=""/>
                    <img src={More} alt=""/>
                </div>
                <Messages/>
            </div>
        </div>
    )
}

export default Chat;
